import React from "react";
import "../timeline/Timeline.css";
import ourfirstlogo from "../images/ourfirstlogo.png";
import azamaka from "../images/azamaka.png";
import afterazamaka from "../images/afterazamaka.png";

const Timeline = () => {
  return (
    <div className="container">
      <div className="timeline">
        <h1>Timeline </h1>
      </div>
      <div className="row">
        <div className="col-sm-12 col-md-6 timelineMain">
          <div>
            <p className="creationofizmasoft text-justify">
              The FizmaSoft Team created in <br></br>Tashkent in 2016.<br></br>{" "}
              Since then the Team has been leading a lot of tech-projects
              successfully...
            </p>
          </div>
          <div>
            <img
              className="ourfirstlogo img-fluid"
              style={{ maxWidth: "100%" }}
              src={ourfirstlogo}
              alt="ourfirstlogo"
            />
          </div>
        </div>
        <div className="col-sm-12 col-md-6">
          <div>
            <img
              className="azamaka img-fluid"
              style={{ maxWidth: "100%" }}
              src={azamaka}
              alt="ourfirstlogo"
            />
          </div>

          <img
            className="afterazamaka img-fluid"
            style={{ maxWidth: "100%" }}
            src={afterazamaka}
            alt="ourfirstlogo"
          />
        </div>
      </div>
    </div>
  );
};

export default Timeline;
